import React from 'react';

export default function Navbar({ onSignupClick }) {
  return (
    <nav className="flex justify-between items-center px-6 py-4 bg-gray-900 text-white">
      <h1 className="text-xl font-bold">CryptoInvest</h1>
      <ul className="flex space-x-6">
        <li><a href="#about" className="hover:text-indigo-400">About Us</a></li>
        <li><a href="#features" className="hover:text-indigo-400">Features</a></li>
        <li><a href="#login" className="hover:text-indigo-400">Login</a></li>
        <li>
          <button
            onClick={onSignupClick}
            className="bg-indigo-600 px-4 py-2 rounded hover:bg-indigo-700 transition"
          >
            Sign Up
          </button>
        </li>
      </ul>
    </nav>
  );
}
